import './App.css'
import Cards from './components/Cards.jsx'
import Nav from './components/Nav'
import characters, { Rick } from './data.js'
import { useState } from 'react';


function App () {
  const [personajes, setPersonajes] = React.useState({
    characters:[]
  })
  return (
    <div className='App'>
      <div>
        <div>
          <Nav/>
        </div>
        <hr/>
        <div>
          <Cards
            characters={characters}
          />
        </div>
      </div>
    </div>
  )
}

export default App
